  const datosConsulta = datos => {
    console.log(datos);
  }  

  return (
      <div className="App">
        <Header
            titulo="Clima React App"
        />

        <div className="contenedor-form">
          <div className="container">
            <div className="row">
              <div className="col s12 m6">
                <Formulario
                datosConsulta={datosConsulta}
                />
              </div>
            </div>
          </div>
        </div>
      </div>

  );
}

export default App;
